// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ServicePayment {
    address public owner;

    event PaymentReceived(address indexed from, uint256 amount);

    constructor() {
        owner = msg.sender; // Owner is the contract deployer
    }

    // Pay for a service in ETH
    function payForService() public payable {
        require(msg.value > 0, "Payment must be greater than 0");
        emit PaymentReceived(msg.sender, msg.value);
    }

    // Withdraw funds to the owner's address
    function withdraw() public {
        require(msg.sender == owner, "Only owner can withdraw");
        payable(owner).transfer(address(this).balance);
    }

    // Get the contract balance (to check if funds are received)
    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }
}
